import React, {Component} from 'react';
import './styles.scss';


class Left extends Component{
  render(){
    return (
	    <div>
	      	<div className="col-md-6 Left">
							<div className="Login">
								<h2>LOGIN</h2>
								<form className="formLogin" action="profile" method="Post">
									Email:<br />
									<input className="Email" placeholder="" type="text"  name ="userEmail" required=""></input>
									<br />
									Password:<br />
									<input className="Pass" placeholder="" type="password"  name ="pws" required=""></input>
								</form>
								<button type="button" class="btn btn-default ">LOGIN</button>
								<button type="button" class="btn btn-default register">SIGN UP</button>
							</div>
			</div>
	    </div>
  );
  }
}

export default Left;
